import React, { useEffect, useState } from 'react';
import { useAnimeState } from '../ducks/anime/selectors';

const Detail = (): JSX.Element => {
	const [details, setDetail] = useState(useAnimeState().anime.items);

	useEffect(() => {
		setDetail({
			...details,
		});
	});

	return <></>;
};

export default Detail;
